import React from 'react';
import '../style.css'



class ProductRegisterForm extends React.Component {

    render() {

        return (
            <main>
                <div class="formAgendarHolder">
                    <div class="formAgendar  shadow">
                        <h1>Novo Produto</h1>
                        <input type="text" placeholder="Nome do produto" class="nameInput"/>
                        <input type="text" placeholder="ID" class="nameInput"/>
                        <input type="text" placeholder="Descrição" class="nameInput"/>
                        <input type="number" placeholder="Preço" class="nameInput"/>
                        <input type="number" placeholder="Quantidade" class="nameInput"/>
                        <input type="file" class="fileInput"/>

                        <button type="submit">Confirmar</button>
                    </div>
                </div>    
            </main>
        );
    }
}

export default ProductRegisterForm;
